import React from "react";
import "./Mission_vission.css";
function About() {
  return (
    <div>
      <h1
        style={{
          textAlign: "center",
          fontFamily: "sans-serif",
          fontSize: "50px",
          marginTop: "25px",
        }}
      >
        <b>About</b>
      </h1>
      <h5 style={{ textAlign: "center" }}>
        Who we are, what we do, and how we test products
      </h5>
      <hr
        style={{
          marginLeft: "5%",
          marginRight: "5%",
        }}
      />
    </div>
  );
}

export default About;
